Nie ma sensu jechać na ten casting aż do Łodzi. Przecież na księdza ja się zupełnie nie nadaję.... Wychodząc już z castingu z tyłu głowy miałem niemal stuprocentową pewność, że reżyser, Dominik Hadziewicz nie obsadzi mnie w tej roli... Kilka.tygodni później dzieci które statystowały w tym filmie nie mogły uwierzyć, że nie jestem prawdziwym "Księdzem Markiem". Jak ostatecznie wypadłem w tej roli zobaczymy jesienią po premierze etiudy filmowej.

Dziękuję bardzo całej ekipie za bardzo dobrą współpracę podczas realizowania scen. Panowała współpraca a nie współzawodnictwo. Odczułem chęć pomocy oraz ją otrzymałem od aktorów oraz reżysera. Nie była to praca pod rygorem dojścia z punktu A do punktu B po linii prostej i matematycznie bezdusznej kalkulacji. Była to piękna praca w procesie twórczym. Wróciłem z kolejnym doświadczeniem i świadomością nad czym jeszcze muszę popracować aby stać się lepszym w budowaniu postaci.

